import React from 'react';
import Token from './Token';


const Ether = (props) => {
  return (

        <Token 
        url={"./img/dydx.svg"}
        assetName={"Ether"} 
        assetAmount={"300 ETH"} 
        assetPrice={"$320"} 
        assetPriceVariation={"+6.7%"}
        assetValue={"$96,000,32"} 
        />

      );
}

export default Ether;
